.report {
  .report-header {
    .el-input__inner {
      text-transform: capitalize;
    }
  }

  .report-item-select {
    text-transform: capitalize;
  }
  &-item-select {
    text-transform: capitalize;
  }
  .pad {
    margin-bottom: 24px;
  }
  .title {
    color: #00adff;
    text-transform: uppercase;
    font-weight: 600;
    width: 500px;
    display: inline-block;
  }
  .el-table th {
    background: #f5f5f5;
  }
  .el-tag.el-tag--APPROVED {
    background-color: #e7faf0;
    border-color: #d0f5e0;
    color: #13ce66;
  }
  .el-tag.el-tag--REJECTED {
    background-color: #f4f4f5;
    border-color: #e9e9eb;
    color: red;
  }
  .el-tag.el-tag--PENDING {
    background-color: #f4f4f5;
    border-color: #e9e9eb;
    color: #909399;
  }
}
.pagination-container {
  background: #fff;
  padding: 32px 16px;
}
.pagination-container.hidden {
  display: none;
}
